import axios from 'axios';
import React, { useCallback, useEffect, useState } from 'react';
import { Container, Input } from 'reactstrap';
import Hml from '../../components/HML/Hml';
import './DealerMargin.css';
const states = [
  'Andhra Pradesh',
  'Arunachal Pradesh',
  'Assam',
  'Bihar',
  'Chhattisgarh',
  'Goa',
  'Gujarat',
  'Haryana',
  'Himachal Pradesh',
  'Jammu and Kashmir',
  'Jharkhand',
  'Karnataka',
  'Kerala',
  'Madhya Pradesh',
  'Maharashtra',
  'Manipur',
  'Meghalaya',
  'Mizoram',
  'Nagaland',
  'Odisha',
  'Punjab',
  'Rajasthan',
  'Sikkim',
  'Tamil Nadu',
  'Telangana',
  'Tripura',
  'Uttarakhand',
  'Uttar Pradesh',
  'West Bengal',
  'Andaman and Nicobar Islands',
  'Chandigarh',
  'Dadra and Nagar Haveli',
  'Daman and Diu',
  'Delhi',
  'Lakshadweep',
  'Puducherry',
];
const DealerMargin = () => {
  const [region, setregion] = useState('');
  const [allStates, setallStates] = useState(initialState);
  const [hirarchytype, sethirarchytype] = useState('');
  const [dataResponse, setdataResponse] = useState('');
  const selectHandle = (e) => {
    setregion(e.target.value);
  };
  const LoadMargin = useCallback(async () => {
    const result = await axios.get('http://localhost:3003/dealerMargin');
    const resultData = result.data[0];
    setdataResponse(resultData[region]);
    const hirarchyType =
      dataResponse === undefined ? '' : Object.keys(dataResponse);
    sethirarchytype(hirarchyType);
  }, [region, dataResponse]);

  useEffect(() => {
    LoadMargin();
  }, [region]);
  return (
    <Container>
      <h4 className='pt-4 pb-5'>Dealer Margin</h4>
      <div className='selectState'>
        <label className='label' htmlFor='State'>
          State
        </label>
        <Input type='select' defaultValue='Set state' onChange={selectHandle}>
          <option value=''>Select state</option>
          {states.map((data, index) => {
            return (
              <option key={index} value={data} name={data}>
                {data}
              </option>
            );
          })}
        </Input>
      </div>
      {dataResponse === undefined ? (
        ''
      ) : dataResponse === '' ? (
        <div className='add_margin d-flex'>+ Add Margin</div>
      ) : (
        <>
          <Hml
            margin={dataResponse.low}
            hirarchytype={hirarchytype[1]}
            hirarchy={dataResponse.hirarchy}
          />
          {console.log(hirarchytype)}
        </>
      )}
    </Container>
  );
};

export default DealerMargin;
